import React from 'react';
import { Navbar as BSNavbar, Nav as BSNav } from 'react-bootstrap';

import { BsHouseDoor, BsPerson, BsBag } from 'react-icons/bs';

import './styles.scss';

const BottomNav = () => {
  return (
    <div className="bottom-nav">
      <BSNavbar bg="light" expand="lg" sticky="bottom">
        <BSNav className="mr-auto">
          <BSNav.Link href="/homepage">
            <BsHouseDoor />
            Home
          </BSNav.Link>
          <BSNav.Link href="/homepage">My Account</BSNav.Link>
          <BSNav.Link href="/cart">Cart</BSNav.Link>
        </BSNav>
      </BSNavbar>
    </div>
  );
};

export default BottomNav;
